uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;
uniform sampler2D iChannel0;

// User Parameters
uniform float u_speed;
uniform float u_scale;
uniform float u_glow;
uniform float u_hue;   // Near Color
uniform float u_hue2;  // Far Color

out vec4 fragColor;

// --- Helper Functions ---

vec3 hsb2rgb(vec3 c) {
    vec3 rgb = clamp(abs(mod(c.x * 6.0 + vec3(0.0, 4.0, 2.0), 6.0) - 3.0) - 1.0, 0.0, 1.0);
    rgb = rgb * rgb * (3.0 - 2.0 * rgb);
    return c.z * mix(vec3(1.0), rgb, c.y);
}

// Color Palette based on Z-Depth
vec3 getDepthColor(float z, float hue1, float hue2) {
    float t = clamp(z * 0.5, 0.0, 1.0);
    float h = mix(hue1, hue2, t);
    float sat = mix(1.0, 0.6, t); 
    // Distance brightness
    float bri = mix(1.0, 0.4, t); 
    return hsb2rgb(vec3(fract(h), sat, bri));
}

void main() {
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;
    vec2 uv0 = uv; // Store original for post-processing

    // Params
    float spd = (u_speed <= 0.0) ? 0.3 : u_speed;
    float time = iTime * spd;
    float scale = (u_scale <= 0.0) ? 1.0 : u_scale;
    float glowInt = (u_glow <= 0.0) ? 1.5 : u_glow;

    // 5-Minute Color Cycle
    float cycle = iTime / 300.0;
    float baseHue1 = (u_hue == 0.0) ? 0.05 : u_hue; 
    float baseHue2 = (u_hue2 == 0.0) ? 0.6 : u_hue2; 
    float hue1 = fract(baseHue1 + cycle);
    float hue2 = fract(baseHue2 + cycle);

    // --- Mirror Logic ---
    // We default to full brightness (1.0)
    float reflectionMask = 1.0;

    // If we are in the top half (sky), flip the UVs to render the floor again
    // And set the mask to 0.3 (30% brightness) for the "Faint Reflection"
    if (uv.y > 0.0) {
        uv.y = -uv.y;       // Flip coordinate to mirror the floor
        reflectionMask = 0.3; // Dim the reflection
    }

    // Background: Deep void color
    vec3 finalColor = vec3(0.01, 0.0, 0.02);

    // Camera Height (Virtual)
    float camHeight = 0.5; 

    // Loop
    const int LAYERS = 40; 

    for(int i = LAYERS; i > 0; i--) {

        // Perspective Z
        float zIndex = float(i) - fract(time * 1.5); 
        float z = zIndex * 0.2; 

        if(z < 0.1) continue; 

        float projection = 1.0 / z;

        // Wave Shape
        float waveX = uv.x * z * 4.0; 
        float worldY = sin(waveX + time + z) * 0.3 * scale;
        worldY += sin(waveX * 0.5 - time) * 0.2 * scale;

        // Project to Screen
        float screenY = (worldY - camHeight) * projection * 0.4;

        // Distance
        float dist = abs(uv.y - screenY);

        // Visuals
        float thickness = 0.006 * projection; 
        float lineGlow = exp(-dist / thickness) * glowInt;

        // Fog / Depth Fade
        float fog = smoothstep(0.0, 0.6, projection); 

        // Color
        vec3 col = getDepthColor(z * 0.15, hue1, hue2);

        // Apply Reflection Mask (dims the top half)
        vec3 drawCol = col * reflectionMask;

        // Composition
        finalColor += drawCol * lineGlow * fog;

        // Fill
        float fill = smoothstep(thickness, 0.0, dist);
        finalColor += drawCol * fill * 0.15 * fog;
    }

    // --- Horizon Line Glow ---
    // A bright strip in the center to hide the seam between real/reflection
    float horizonGlow = exp(-abs(uv0.y) * 20.0);
    vec3 horizonCol = hsb2rgb(vec3(hue2, 0.5, 1.0)); // Use Far Color
    finalColor += horizonCol * horizonGlow * 0.5;

    // Post-Processing
    // Vignette
    finalColor *= 1.2 - length(uv0) * 0.5;

    // Clamp
    finalColor = smoothstep(-0.01, 1.3, finalColor);

    fragColor = vec4(finalColor, 1.0);
}

